namespace MultiFlexi\Executor;

use Symfony\Component\Process\Process;

/**
 * Description of Native.
 *
 * @author vitex
 *
 * @no-named-arguments
 */
class Native extends \MultiFlexi\CommonExecutor implements \MultiFlexi\executor
{
    public $timeout = 32767;
    private \Symfony\Component\Process\Process $process;
    private string $commandline;
    private \MultiFlexi\ConfigFields $jobFiles;

    public static function name(): string
    {
        return _('Native');
    }

    public static function description(): string
    {
        return _('Run Job on same machine as MultiFlexi itself');
    }

    public function setJob(\MultiFlexi\Job &$job): void
    {
        parent::setJob($job);
        $this->jobFiles = (new \MultiFlexi\FileStore())->extractFilesForJob($this->job);
        $this->environment->addFields($this->jobFiles);
    }

    /**
     * @return string
     */
    public function executable()
    {
        return $this->job->application->getDataValue('executable');
    }

    /**
     * @return string
     */
    public function cmdparams()
    {
        return $this->job->getCmdParams();
    }

    public function commandline(): string
    {
        $this->job->setEnvironment($this->environment);

        return $this->executable().' '.$this->cmdparams();
    }

    public function launch($command)
    {
        $this->process = new \Symfony\Component\Process\Process(explode(' ', $command), null, $this->environment->getEnvArray(), null, $this->timeout);

        try {
            $this->process->run(function ($type, $buffer): void {
                $this->pid = $this->process->getPid();

                if ($this->pid) {
                    $this->job->setPid($this->pid);
                }

                $logger = new \Ease\Sand();
                $logger->setObjectName(\Ease\Logger\Message::getCallerName($this));
                $logger->addStatusMessage('JOB: '.$this->job->getMyKey().' PID: '.$this->pid, $type, 'debug');

                $liveOutputSocket = \Ease\Shared::cfg('LIVE_OUTPUT_SOCKET');

                if ($liveOutputSocket) {
                    $wsClient = new \WebSocket\Client($liveOutputSocket);
                }

                if (\Symfony\Component\Process\Process::ERR === $type) {
                    $logger->addStatusMessage($buffer, 'error');
                    $this->addOutput($buffer, 'error');

                    if ($liveOutputSocket) {
                        try {
                            $wsClient->send(json_encode(['type' => 'error', 'message' => $buffer]), 'binary');
                        } catch (\Exception $exc) {
                            echo $exc->getTraceAsString();
                        }
                    }
                } else {
                    $logger->addStatusMessage($buffer, 'success');
                    $this->addOutput($buffer, 'success');

                    if ($liveOutputSocket) {
                        try {
                            $wsClient->send(json_encode(['type' => 'success', 'message' => $buffer]), 'binary');
                        } catch (Exception $exc) {
                            echo $exc->getTraceAsString();
                        }
                    }
                }
            });
        } catch (\Symfony\Component\Process\Exception\ProcessTimedOutException $exc) {
            $this->addStatusMessage(sprintf(_('Process exceeded maximum execution time limit %d seconds'), $this->timeout), 'error');
        }

        $this->addStatusMessage('pid:'.(isset($this->pid) ? (string) ($this->pid) : 'n/a').' '.$command.': '.$this->process->getExitCodeText(), $this->process->getExitCode() === 0 ? 'success' : 'warning');

        foreach ($this->jobFiles as $file) {
            unlink($file['value']);
        }

        return $this->process->getExitCode();
    }

    public function launchJob(): void
    {
        $this->commandline = $this->commandline();
        $this->setDataValue('commandline', $this->commandline);
        $this->addStatusMessage('Job launched: '.$this->job->application->getDataValue('name').'@'.$this->job->company->getDataValue('name').' : '.$this->job->runTemplate->getRecordName().' Runtemplate: #'.$this->job->runTemplate->getMyKey());
        $this->launch($this->commandline());
        $this->addStatusMessage('Job launch finished: '.$this->executable().'@'.$this->job->application->getDataValue('name').' '.$this->process->getExitCodeText());
    }

    /**
     * @todo Implement
     */
    public function runJob(): void
    {
        $this->launchInBackground($this->commandline());
    }

    public function storeLogs(): void
    {
    }

    /**
     * Can this Executor execute given application ?
     *
     * @param Application $app
     */
    public static function usableForApp($app): bool
    {
        return \is_object($app); // Every application can be launched by native executor yet
    }

    public static function logo(): string
    {
        return 'data:image/svg+xml;base64,';
    }

    public function getErrorOutput(): string
    {
        return $this->process->getErrorOutput();
    }

    public function getExitCode(): int
    {
        return $this->process->getExitCode();
    }

    public function getOutput(): string
    {
        return $this->process->getOutput();
    }

    /**
     * Launch a command in a non-blocking separate thread using Symfony Process.
     *
     * @todo Implement
     *
     * @param string $command the command to execute
     */
    private function launchInBackground(string $command): void
    {
        $process = Process::fromShellCommandline($command);
        $process->start();

        // Optionally, you can add a callback to handle output or errors
        $process->wait(static function ($type, $buffer): void {
            if (Process::ERR === $type) {
                echo 'ERR > '.$buffer;
            } else {
                echo 'OUT > '.$buffer;
            }
        });
    }
}
